// In src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Auth0Provider } from '@auth0/auth0-react';
import { loadStripe } from '@stripe/stripe-js';
import { Elements } from '@stripe/react-stripe-js';
import Layout from './components/Layout'; // Import the Layout component
import EventsPage from './components/EventsPage';
import YourOrderPage from './components/YourOrderPage';
import BlogPage from './components/BlogPage';
import PaymentPage from './components/PaymentPage';
import { CartProvider } from './components/CartContext';

const stripePromise = loadStripe('YOUR_STRIPE_PUBLIC_KEY');

const auth0Domain = "YOUR_AUTH0_DOMAIN";
const auth0ClientId = "YOUR_AUTH0_CLIENT_ID";

function App() {
  return (
    <Auth0Provider domain={auth0Domain} clientId={auth0ClientId} redirectUri={window.location.origin}>
      <Router>
        <Elements stripe={stripePromise}>
          <CartProvider>
            <Layout>
              <Routes>
                <Route path="/" element={<EventsPage />} />
                <Route path="/events" element={<EventsPage />} />
                <Route path="/your-order" element={<YourOrderPage />} />
                <Route path="/blog" element={<BlogPage />} />
                <Route path="/payment" element={<PaymentPage />} />
                <Route path="*" element={<EventsPage />} />
              </Routes>
            </Layout>
          </CartProvider>
        </Elements>
      </Router>
    </Auth0Provider>
  );
}

export default App;
